自己撥水！<br>初期払拭性能を持続する交換ゴム<br><br><br>●抜群の効果を発揮するエクセルコートワイパーの替えゴム<br>●一般ワイパー・グラファイトワイパー・シリコンコートワイパーの優れた機能を凝縮<br>●ビビリを抑え、圧倒的な拭きを実現！しかも拭くだけで撥水コーティングが可能<br>●グラファイトワイパーに比べ、耐紫外線性・耐オゾン性・耐熱性を大幅に向上<br>●優れた性能を凝縮した企画的な汎用ワイパー替えゴム<br><br>車種別の適合についてはPIAAホームページにてご確認ください。<br><br><br>■仕様<br>品名：エクセルコートワイパー替えゴム<br>品番：EXR55<br>呼番：12<br>メーカー：PIAA<br>サイズ：550mm<style type="text/css">
