超撥水！5分で撥水コーティング！超強力シリコート替えゴム<br>レース車両にも採用されています！<br><br><br>「超強力シリコート」ワイパーは、ワイパーをわずか5分作動させるだけで、ウインドウガラスを完璧に撥水コーティングします。<br><br>また、ウインドウガラスを撥水コーティングをされている車でも使用できます。撥水効果が薄れてきた部分に対しては、撥水被膜を再度形成する「補修能力」を持っていますので、長時間撥水効果が持続します。<br><br>シリコートワイパーは、雨を水玉に変えることができます。水玉になることで、水滴ごとの空間が広がり、雨の日でも安全な視界を確保できます。<br><br><br>●撥水被膜を補修<br> ●特殊シリコンオイル配合<br>●特殊シリコンゴム採用<br>●ガラス撥水コーティング車対応<br><br><br>■仕様<br>メーカー：PIAA<br>品名：超強力シリコート替えゴム<br>品番：SUR47<br>サイズ：475mm<br>呼番：8<style type="text/css">
